import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const SetPickUp = () => {
  return (
    <View>
      <Text>SetPickUp</Text>
    </View>
  )
}

export default SetPickUp

const styles = StyleSheet.create({})
